  const [C1SENGAERO, setC1SENGAERO] = useState([])
  const [F7ENGINT, setF7ENGINT] = useState([])

  useEffect(() => {
    setData({
      labels: label,

      datasets: [
        {
          label: "F7LENGFAL",
          data: F7LENGFAL,
          borderWidth: 1,
          lineTension: 0,
          borderColor: "#cc0000",
          fill: false
