          data: F7ENGELEC,
          borderWidth: 1,
          lineTension: 0,
          borderColor: "black",
          fill: false
        },
        {
          label: "F7ENGELEC",
          data: F7ENGELEC,
          borderWidth: 1,
          lineTension: 0,
          borderColor: "#000000",
          fill: false
        },
        {
          label: "F7ENGINS",
          data: F7ENGINS,
          borderWidth: 1,
          lineTension: 0,
          borderColor: "#999999",
